import { Typography, Container } from '@mui/material';
import logo from '../images/logo.svg'; // Adjust the path to where your logo.svg is located
import '../styles/Footer.css'; // Import the CSS file

const Footer = () => {
    return (
      <footer className="footer">
        <Container>
          <div className="footer-content">
            <div className="footer-left">
              <Typography variant="body1" className="footer-heading">HOURS:</Typography>
              <Typography variant="body1" className="footer-value">Mon-Fri: 9 AM - 6 PM</Typography>
              <Typography variant="body1" className="footer-heading">PHONE:</Typography>
              <Typography variant="body1" className="footer-value">(123) 456-7890</Typography>
              <Typography variant="body1" className="footer-heading">EMAIL:</Typography>
              <Typography variant="body1" className="footer-value">info@nailtique.com</Typography>
            </div>
            <div className="logo-container">
              <img
                src={logo}
                alt="Logo"
                className="footer-logo"
              />
            </div>
          </div>
          <Typography variant="body1" align="center">
            Â© 2024 NailTique Closter
          </Typography>
        </Container>
      </footer>
    );
  };

  export default Footer;
